    render() {
        const {title,pokemons} = this.props;
    return( 
        <div className ='pokedex'>
            <div className ='title-container'>
            {pokemons.map(
            pokemon => <Pokemon key={pokemon.id} pokemon ={pokemon} />) }
            </div>
        </div> 
    )
    };

static defaultProps = {
    title:PropTypes.string,
  }
}
